INSERT INTO `folders` (`id`, `name`, `folder_type`, `parent_folder`, `has_child`, `is_group`, `is_dynamic`, `dynamic_query`, `assign_to_id`, `created_by`, `modified_by`, `deleted`) VALUES
('1459669d-80e3-1beb-2496-5afea251a5ff', 'My Drafts', 'draft', 'f423ed0c-52f0-4716-aba4-5afea2c47b4a', 0, 0, 1, 'SELECT emails.id polymorphic_id, \'Emails\' polymorphic_module FROM emails\n								   JOIN emails_text on emails.id = emails_text.email_id\n                                   WHERE (type = \'draft\' OR status = \'draft\') AND assigned_user_id = \'1\' AND emails.deleted = \'0\' AND status NOT IN (\'archived\') AND type NOT IN (\'archived\')', '', '1', '1', 0),
('14fc869d-c8ed-4f3f-32be-5afea227ebc6', 'Sent Emails', 'sent', 'f423ed0c-52f0-4716-aba4-5afea2c47b4a', 0, 0, 1, 'SELECT emails.id polymorphic_id, \'Emails\' polymorphic_module FROM emails\n								   JOIN emails_text on emails.id = emails_text.email_id\n                                   WHERE (type = \'out\' OR status = \'sent\') AND assigned_user_id = \'1\' AND emails.deleted = \'0\' AND status NOT IN (\'archived\') AND type NOT IN (\'archived\')', '', '1', '1', 0),
('1589dbac-8472-d4ac-8105-5afea2da476c', 'My Archived Emails', 'archived', 'f423ed0c-52f0-4716-aba4-5afea2c47b4a', 0, 0, 1, '', '', '1', '1', 0),
('f423ed0c-52f0-4716-aba4-5afea2c47b4a', 'My Email', 'inbound', '', 1, 0, 1, 'SELECT emails.id polymorphic_id, \'Emails\' polymorphic_module FROM emails\n								   JOIN emails_text on emails.id = emails_text.email_id\n                                   WHERE (type = \'inbound\' OR status = \'inbound\') AND assigned_user_id = \'1\' AND emails.deleted = \'0\' AND status NOT IN (\'sent\', \'archived\', \'draft\') AND type NOT IN (\'out\', \'archived\', \'draft\')', '', '1', '1', 0);
